package Wrapper;

public class StringToInt {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        String a="kethan";
        int n=Integer.parseInt(a);
        int c=10;
        String d=String.valueOf(c);
        System.out.println(n+10);
        System.out.println(d+10);
        
	}

}
